ATENÇÃO, ELEITOR
⚠️
Eleição é um ato sério. Um voto errado pode prejudicar você, sua família e amigos por 04 anos...
 Nessas eleições agora, são 11 candidatos à presidência do Brasil. Não se deixe levar pela imprensa ou pesquisas. Mas fique sabendo bem que dos 11 candidatos:

-Somente UM candidato defende o Aborto;
- Somente UM candidato defende a ideologia de gênero nas escolas;
-Somente UM candidato é contra as igrejas;
-Somente UM candidato é contra a Policia Militar;
- Somente UM candidato permite a banalização da Pedofilia; 
- Somente UM candidato defende o Comunismo;
-Somente UM candidato já foi PRESO...

Este UM candidato é o LULA, 
Portanto, ajude a proteger seu Brasil , sua família e amigos. Escolha um entre os outros 10 para votar. Pesquise, pergunte os números dos demais candidatos á presidência...
Vote pelo bem de todos nós ! 🙌🏽

